import React from "react";
import Layout from "../Layout/Layout";
import { Box, Stack, Paper } from "@mui/material";
import "../Home/HomeStyle.css";
import { styled } from "@mui/material/styles";
import { Link } from "react-router-dom";
import NewQuiz from "../../images/NewQuiz.jpg";
import MyQuiz from "../../images/MyQuiz.jpg";
import PlayQuiz from "../../images/PlayQuiz.jpg";
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';

const Item = styled(Paper)(({ theme }) => ({
  height: "350px",
  width: "30vw",
  padding: theme.spacing(1),
  display: "flex",
}));

const Home = () => {
  return (
    <Layout>
      <Box className="Home-Box1" sx={{ p: 2 }}>
        <Stack
          direction="row"
          className="stack"
          sx={{ display: { xs: "block", sm: "flex" } }}
        >
          <Item
            className="content-box"
            sx={{
              backgroundImage: `url(${NewQuiz})`,
              backgroundSize: "cover",
              backgroundPosition: "center",
              borderRadius: "20px",
              "@media(max-width:600px)": {
                height: "250px",
                width: "300px",
                marginBottom: "20px",
              },
            }}
          >
            <Link to="/newquiz">Create New Quiz</Link>
          </Item>
          <Item
            className="content-box"
            sx={{
              maxWidth: "350",
              backgroundImage: `url(${MyQuiz})`,
              backgroundSize: "cover",
              borderRadius: "20px",
              "@media(max-width:600px)": { height: "250px", width: "300px" },
            }}
          >
            <Link to="/Quiz">My Quizes</Link>
          </Item>
          {/* <Item
            className="content-box"
            sx={{
              maxWidth: "350",
              backgroundImage: `url(${PlayQuiz})`,
              backgroundSize: "cover",
              borderRadius: "20px",
              "@media(max-width:600px)": {
                height: "250px",
                width: "300px",
                marginTop: "20px",
              },
            }}
          >
            <Link to="/PlayQuiz">Play Quiz</Link>
          </Item> */}
        </Stack>
      </Box>
      <Card sx={{ maxWidth: 345 }}>
      <CardMedia
        component="img"
        alt="green iguana"
        height="140"
        image="/static/images/cards/contemplative-reptile.jpg"
      />
      <CardContent>
        <Typography gutterBottom variant="h5" component="div">
          Lizard
        </Typography>
        <Typography variant="body2" color="text.secondary">
          Lizards are a widespread group of squamate reptiles, with over 6,000
          species, ranging across all continents except Antarctica
        </Typography>
      </CardContent>
      <CardActions>
        <Button size="small">Share</Button>
        <Button size="small">Learn More</Button>
      </CardActions>
    </Card>
    </Layout>
  );
};

export default Home;
